import Vue from 'vue'
import Router from 'vue-router'
import Welcome from './views/welcome/Welcome.vue'
import Create from './views/create/Create.vue'
import Login from './views/login/Login.vue'
import Recover from './views/recover/Recover.vue'
import MoneyBag from './views/money/MoneyBag.vue'
import MoneyAAA from './views/money/MoneyAAA.vue'
import MoneyUSDT from './views/money/MoneyUSDT.vue'
import MoneyHome from './views/money/MoneyHome.vue'
import MoneyReceipt from './views/money/MoneyReceipt.vue'
import MoneyTransfer from './views/money/MoneyTransfer.vue'
import MoneyAssign from './views/money/MoneyAssign.vue'
import Signature from './views/signature/Signature.vue'
Vue.use(Router)

export default new Router({
  // mode: 'history',
  routes: [{
      // 选择页面
      path: '/',
      name: 'welcome',
      component: Welcome
    },
    {
      // 创建身份页面
      path: '/create/:id?',
      name: 'create',
      component: Create
    },
    {
      // 登录页面
      path: '/login',
      name: 'login',
      component: Login
    },
    {
      // 恢复页面
      path: '/recover',
      name: 'recover',
      component: Recover
    },
    {
      // 钱包主页
      path: '/money-home',
      name: 'money-home',
      component: MoneyHome
    },
    {
      // 钱包主页
      path: '/money-bag',
      name: 'money-bag',
      component: MoneyBag
    },
    {
      // aaa 钱包
      path: '/money-aaa',
      name: 'money-aaa',
      component: MoneyAAA
    },
    {
      // usdt 钱包
      path: '/money-usdt',
      name: 'money-usdt',
      component: MoneyUSDT
    },
    {
      // 钱包收款
      path: '/money-receipt',
      name: 'money-receipt',
      component: MoneyReceipt
    },
    {
      // 钱包转账
      path: '/money-transfer',
      name: 'money-transfer',
      component: MoneyTransfer
    },
    {
      // 钱包设定金额
      path: '/money-assign',
      name: 'money-assign',
      component: MoneyAssign
    },
    {
      // 签名页面
      path: '/signature',
      name: 'signature',
      component: Signature
    }
  ]
})
